defs.script:

   window.onload=function (){

	  var paths=document.getElementsByTagName("path");
	  for (var i=0;i<paths.length;i++){
	   paths[i].color=window.getComputedStyle(paths[i],null).fill
	   if(i==2){
	   continue;
	   }
	   paths[i].onmouseover=function (){
	     this.style.fill="red";
	   }
	   paths[i].onmouseout=function (){
	      this.style.fill=this.color;
	   }
	  }
   }
